<script>
  import "animate.css";
  import { onMount } from "svelte";
  import Login from "./lib/Login/Login.svelte";
import MenuDocentes from "./lib/Login/MenusDocentes/MenuDocentes.svelte";
  import NavPrincipal from "./NavPrincipal/NavPrincipal.svelte";
  import { URL, Periodos, Asignacion, Docentes } from "./stores";
  let login = false;

  const getPeriodos = async () => {
    const response = await fetch(
      "https://app.iedeoccidente.com/getPeriodosNotas.php",
      {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
      }
    );
    const data = await response.json();
    return data;
  };

  const getAsignacion = async () => {
    const response = await fetch(
      "https://app.iedeoccidente.com/getasignacion.php",
      {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
      }
    );
    const data = await response.json();
    return data;
  };

  const getDocentes = async () => {
    const response = await fetch(
      "https://app.iedeoccidente.com/getInfoDocentes.php",
      {
        method: "POST",
        body: JSON.stringify({ periodo: "-", x: "x" }),
        headers: {
          "Content-Type": "application/json",
        },
      }
    );
    const data = await response.json();
    return data;
  };
  onMount(async () => {
    let isProduction = import.meta.env.MODE === "production";
    if (isProduction) $URL = "";
    else $URL = "https://app.iedeoccidente.com/";

    $Periodos = await getPeriodos();
    $Asignacion = await getAsignacion();
    $Docentes = await getDocentes();
  });

  let generaMenus = false;
  let concedido=false;
  $: console.log(login);
</script>

<main class="vh-100">
  {#if login}
    <Login
      on:closeModal={() => {
        login = false;
      }}
      on:concedido={() => {
        login = false;
        concedido = true;
        generaMenus = true;
      }}
    />
  {/if}

  <NavPrincipal
    on:openLogin={() => {
      generaMenus = false;
      concedido=false;
      login = true;
    }}
  />

  {#if generaMenus}
  <MenuDocentes/>
  {/if}

  {#if !concedido}
  <div class="descudo">
    <img
      id="escudo"
      class="escudo"
      src="data:image/png;base64,"
      alt=""
    />
  </div>
  {/if}
</main>

<style>
  .escudo {
    position: absolute;
    margin: auto;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
  }
</style>
